SET sql_mode='NO_BACKSLASH_ESCAPES';
CREATE TABLE IF NOT EXISTS `django_migrations` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group_permissions` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `auth_user_groups` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `auth_user_user_permissions` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `django_admin_log` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `object_id` text NULL, `object_repr` varchar(200) NOT NULL, `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0), `change_message` text NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `user_id` integer NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `action_time` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `django_content_type` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_permission` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `content_type_id` integer NOT NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS `auth_user` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `password` varchar(128) NOT NULL, `last_login` datetime NULL, `is_superuser` bool NOT NULL, `username` varchar(150) NOT NULL UNIQUE, `last_name` varchar(150) NOT NULL, `email` varchar(254) NOT NULL, `is_staff` bool NOT NULL, `is_active` bool NOT NULL, `date_joined` datetime NOT NULL, `first_name` varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` text NOT NULL, `expire_date` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `stock_parentcategory` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS `stock_purchasehistory` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `target_name` varchar(255) NOT NULL, `num` integer NOT NULL, `date` date NOT NULL, `item_id` bigint NOT NULL REFERENCES `stock_item` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `stock_item` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(255) NOT NULL, `parent_id` bigint NOT NULL REFERENCES `stock_parentcategory` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `stock_warehouse` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `material_id` bigint NOT NULL REFERENCES `stock_material` (`id`) DEFERRABLE INITIALLY DEFERRED, `num` decimal NULL);
CREATE TABLE IF NOT EXISTS `stock_warehousehistory` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `target_name` varchar(255) NOT NULL, `value` decimal NULL, `num` decimal NULL, `material_name` varchar(255) NOT NULL, `material_item_name` varchar(255) NOT NULL, `material_unit` varchar(255) NOT NULL, `date` date NOT NULL, `is_send` bool NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `stock_role` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS `stock_material_role` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `material_id` bigint NOT NULL REFERENCES `stock_material` (`id`) DEFERRABLE INITIALLY DEFERRED, `role_id` bigint NOT NULL REFERENCES `stock_role` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `stock_profile` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `affiliated_store` varchar(255) NOT NULL, `user_id` integer NOT NULL UNIQUE REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `stock_material` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(255) NOT NULL, `note` text NULL, `item_id` bigint NULL REFERENCES `stock_item` (`id`) DEFERRABLE INITIALLY DEFERRED, `value` decimal NULL, `unit` varchar(255) NOT NULL, `place` varchar(255) NOT NULL, `bottle_num` integer NULL, `is_bottle_deposit` bool NULL, `is_drink_gst` bool NULL, `is_gst` bool NULL, `is_pst` bool NULL, `is_recycle_fee` bool NULL);
CREATE TABLE IF NOT EXISTS `stock_shoppinghistory` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `target_name` varchar(255) NOT NULL, `date` date NOT NULL, `is_send` bool NULL, `material_name` varchar(255) NOT NULL, `value` decimal NULL, `material_unit` varchar(255) NOT NULL, `num` decimal NULL, `material_item_name` varchar(255) NOT NULL, `created_at` datetime NOT NULL, `updated_at` datetime NOT NULL, `material_parent_category_name` varchar(255) NOT NULL, `bottle_deposit` decimal NULL, `drink_gst` decimal NULL, `gst` decimal NULL, `pst` decimal NULL, `recycle_fee` decimal NULL, `material_position_name` varchar(255) NULL);
